import React from 'react';
import {
	Grid,
	GridItem,
	Box,
} from '@chakra-ui/react';

const MainPage = () => {
	return (
			<Grid templateColumns='repeat(10, 1fr)' gap={3} h='1000vh' mt='5%'>
				<GridItem colSpan={3} bg='tomato' h='20px'></GridItem>
				<GridItem colStart={4} colEnd={11} bg='papayawhip' />
			</Grid>
	)
}

export default MainPage;
